func getAdj(index int) (adjective string, ok bool) {
	if index > len(adj) {
		return "", false
	}

	if index < 0 {
		return "", false
	}

	return adj[index], true
}

func getNoun(index int) (noun string, ok bool) {
	if index > len(nouns) {
		return "", false
	}

	if index < 0 {
		return "", false
	}

	return nouns[index], true
}

func MakeName(index int, blockHeight int64) string {
	n, ok := getNoun(index % len(nouns))
	if !ok {
		n = ""
	}

	a, ok := getAdj(index % len(adj))
	if !ok {
		a = ""
	}

	s := fmt.Sprintf("%s-%s-%03d", strings.ToLower(a), strings.ReplaceAll(strings.ToLower(n), " ", "-"), blockHeight%1000)

	return s
}
